import Vue from "vue";
import VueRouter from "vue-router";
import { initializeApp } from "firebase/app";
// import HomeView from "../views/HomeView.vue";
import HomePage from "../views/HomePage.vue";

Vue.use(VueRouter);

const firebaseConfig = {
  apiKey: "AIzaSyC2OENFDEV5CgZBqFxnHNv36C3yrILyzJo",
  authDomain: "upload-firebase-storage-32b85.firebaseapp.com",
  projectId: "upload-firebase-storage-32b85",
  storageBucket: "upload-firebase-storage-32b85.appspot.com",
  messagingSenderId: "338166469167",
  appId: "1:338166469167:web:240e829ce1ef3196882cda",
};

const app = initializeApp(firebaseConfig);

const routes = [
  {
    path: "/",
    name: "homepage",
    component: HomePage,
  },
  {
    path: "/about",
    name: "about",
  },
];

const router = new VueRouter({
  mode: "history",
  base: process.env.BASE_URL,
  routes,
});

export default router;
